import React, { useEffect, useState } from 'react';
import './CSS/styles.css'
const Header = () => {
  const [links, setLinks] = useState([]);
  useEffect(() => {
    setLinks([
      {
        "name": 'linkedin',
        'url': "https://www.linkedin.com/in/hdevavan/",
        'icon': ""
      },
      {
        "name": 'github',
        'url': "https://github.com/Devavanshi-Harsh",
        'icon': ""
      },
      {
        "name": 'hackerrank',
        'url': "https://www.hackerrank.com/HarshDevavanshi",
        'icon': ""
      },
    ])
  }, [])

  return (
    <div>
      <h1 id='name'>Harsh Devavanshi</h1>
      <ul>
        {
          links.map((item, index) => {
            return (
              <label key={index} htmlFor={item.name}><a href={item.url} id={item.name} target='.blank' >{item.name}</a></label>
            )
          })
        }
      </ul>
    </div>
  );
};

export default Header;
